import React from "react";
import "./Home.scss";

const Home = () => {
  return (
    <div className="Home">
      <div className="layout-container">
        <div className="title">
          <h1>HI. I'm developer</h1>
        </div>
      </div>
    </div>
  );
};

export default Home;
